step.command:
use strict;
use warnings; 
use utf8; 
use Encode;
use JSON::PP;
use Switch; 
use ElectricCommander;
ElectricCommander::initEncodings();
$| = 1; 

my $ec = new ElectricCommander();

my $numberOfFiles= 100 + int(rand(30));
my $lineOfCode = 100512 + int(rand(1000));
my $bufferOverrun = int(rand(20));
my $leak = int(rand(10));
my $unreachableCall= int(rand(20));
my $freeNullPointer= int(rand(20));
my $castAltersValue= int(rand(20));
my $redundantCondition = int(rand(10));
my $total = $bufferOverrun + $unreachableCall + $leak + $freeNullPointer + $castAltersValue + $redundantCondition;

my $payload = qq{{
  "buildNumber": $[/server/ec_counters/jobCounter],
  "numberOfFiles": $numberOfFiles,
  "lineOfCode" : $lineOfCode,  
  "bufferOverrun": $bufferOverrun,
  "leak": $leak,
  "unreachableCall": $unreachableCall,
  "freeNullPointer": $freeNullPointer,
  "castAltersValue": $castAltersValue,
  "redundantCondition": $redundantCondition,
  "total" : $total,
  "start": "$[/timestamp yyyy-MM-dd HH:mm:ss]",
  "outcome": "success"
}};


$ec->sendReportingData({reportObjectTypeName => "codesonar_report", payload => $payload});

use strict;
use warnings; 
use utf8; 
use Encode;
use JSON::PP;
use Switch; 
use ElectricCommander;
ElectricCommander::initEncodings();
$| = 1; 

my $ec = new ElectricCommander();

sub RoundXL {
  sprintf("%.$_[1]f", $_[0]);
}

my $inc = int(rand(30));
my $numberOfFiles= 100 + $inc ;
my $numberOfFiles_metric =  &RoundXL($inc /$numberOfFiles * 100, 0);

$inc = int(rand(5000));
my $lineOfCode = 100512 + $inc;

$inc = int(rand(20));
my $fileCompliance = 80 + $inc;
my $fileCompliance_metric = &RoundXL($inc /$fileCompliance * 100, 0);

$inc = int(rand(20));
my $projectCompliance = 80 + $inc;
my $projectCompliance_metric = &RoundXL($inc /$projectCompliance * 100, 0);

my $CTCYC= 10 + int(rand(30));
my $STMIF= 18 + int(rand(30));
my $STCAL = 13 + int(rand(30));

my $payload = qq{{
  "buildNumber": $[/server/ec_counters/jobCounter],
  "numberOfFiles": $numberOfFiles,
  "numberOfFiles_metric": $numberOfFiles_metric,
  "lineOfCode" : $lineOfCode,  
  "fileCompliance": $fileCompliance,
  "fileCompliance_metric": $fileCompliance_metric,
  "projectCompliance": $projectCompliance,
  "projectCompliance_metric": $projectCompliance_metric,
  "CTCYC": $CTCYC,
  "STMIF": $STMIF,
  "STCAL": $STCAL,
  "start": "$[Start]",
  "outcome": "success"
}};


$ec->sendReportingData({reportObjectTypeName => "qac_compliancereport", payload => $payload});

use strict;
use warnings; 
use utf8; 
use Encode;
use JSON::PP;
use Switch; 
use ElectricCommander;
ElectricCommander::initEncodings();
$| = 1; 

my $ec = new ElectricCommander();

sub RoundXL {
  sprintf("%.$_[1]f", $_[0]);
}

my $inc = int(rand(30));
my $numberOfFiles= 100 - $inc ;
my $numberOfFiles_metric =  &RoundXL($inc /$numberOfFiles * 100, 0)* (-1);

$inc = int(rand(5000));
my $lineOfCode = 100512 + $inc;

$inc = int(rand(20));
my $fileCompliance = 90 - $inc;
my $fileCompliance_metric = &RoundXL($inc /$fileCompliance * 100, 0)* (-1);

$inc = int(rand(20));
my $projectCompliance = 80 + $inc;
my $projectCompliance_metric = &RoundXL($inc /$projectCompliance * 100, 0);

my $CTCYC= 10 + int(rand(30));
my $STMIF= 18 + int(rand(30));
my $STCAL = 13 + int(rand(30));

my $payload = qq{{
  "buildNumber": $[/server/ec_counters/jobCounter],
  "numberOfFiles": $numberOfFiles,
  "numberOfFiles_metric": $numberOfFiles_metric,
  "lineOfCode" : $lineOfCode,  
  "fileCompliance": $fileCompliance,
  "fileCompliance_metric": $fileCompliance_metric,
  "projectCompliance": $projectCompliance,
  "projectCompliance_metric": $projectCompliance_metric,
  "CTCYC": $CTCYC,
  "STMIF": $STMIF,
  "STCAL": $STCAL,
  "start": "$[Start]",
  "outcome": "success"
}};


$ec->sendReportingData({reportObjectTypeName => "qac_compliancereport", payload => $payload});
